import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Import CSS for styling

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className='container1'>
                <h1 class="heading">BOOKTECH</h1>
            <img src="https://img.freepik.com/free-psd/realistic-books-illustration_23-2150583557.jpg?t=st=1727979132~exp=1727982732~hmac=3266f1ec4faf7baa0d575c1b52566485565d25e4d0169c647cfc4d0310cadf4f&w=740" alt="Library Logo" className="logo" /> {/* Use image here */}
            </div>
            
            <ul className="nav-links">
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/add-book">Add Book</Link>
                </li>
                <li>
                    <Link to="/my-library">My Library</Link>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
